    "2013-vessel-density",nt"isopen": false,nt"url": null,nt"notes": "Automatic
    Identification Systems (AIS) are a navigation safety device that transmits and monitors
    the location and characteristics of many vessels in U.S. and international waters
    in real-time. This dataset represents the density of vessel traffic in 2013 for
    the contiguous United States offshore waters from vessels with AIS transponders
    in 100 meter grid cells. The dataset is best interpreted using a high to low density
    scale and does not represent actual vessel counts.",nt"license_title": null,nt"extras":
